import React from 'react';

const Launch = (props) => (
  <div>
    <div>{this.props.name}</div>
    <div>{this.props.rocket.name}</div>
    <div>{this.props.rocket.link}</div>
    <div>{this.props.agency.name}</div>
    <div>{this.props.agency.link}</div>
    <div>{this.props.location}</div>
    <div>{this.props.time}</div>
    {this.props.links.map((link,i) => (<div key={i}>{link}</div>))}
  </div>
)

export default Launch;
